import React from 'react';
import Reg from './componentsReg/Reg';
import Regp from './componentsReg/Regp';
import './Register.css';

export default class Register extends React.Component {
  state = {
    register: [],
  };

  Reg = (fr, nm, em, ps, ph) => {
    const Reg = {
      name: nm,
      frstname: fr,
      email: em,
      password: ps,
      phone: ph,
      id: this.newId++,
    };
    this.setState(({ register }) => {
      const myRegister = [...register, Reg];
      return { register: myRegister };
    });
  };
  render() {
    const { register } = this.state;
    return (
      <div className='login'>
        <Reg Reg={this.Reg} />
        <div className='item'>
          {register.map((item2) => {
            return <Regp {...item2} />;
          })}
        </div>
      </div>
    );
  }
}
